import React, { Component } from 'react';

class Options extends Component {
    constructor(props) {
        super()
    }

    render() {
        return (
            <React.Fragment>
                <div className='container-fluid'>
                    <button onClick='lang'>Language</button>
                    <button onClick='lang'>Frontend</button>
                    <button onClick='lang'>Backend</button>
                    <button onClick='lang'>Others</button>
                </div>
            </React.Fragment>
        );

        function lang() {
            this.props.option = 1;
        }
    }
}

export default Options;
